import React, {useState, useEffect, useRef} from "react";

function PatientApp({patienter}) {
  const [currentValue, setCurrentValue] = useState(0);
  const previousValue = useRef(currentValue);

  // Uppdatera currentValue och previousValue varje gång patienter ändras
  useEffect(() => {
    previousValue.current = currentValue;
    setCurrentValue(patienter.length);
  }, [patienter]);

  return (
    <div>
      <p>Nuvarande värde: {currentValue}</p>
      <p>Föregående värde: {previousValue.current}</p>
    </div>
  );
}

export default PatientApp;
